import React from 'react';
import { Container } from './ProjectElements';

const Project = (props) => {
    const tags = props.tags;
    const title = props.title;
    const image = props.title;

    showTags = () => {
        tags.map(function(tags, i){
            return (
            <span>{tags[i]}</span>
            );
        });
    }

    return (
        <Container>
            <span>{title}</span>
            <span>{tags}</span>
            {showTags}
        </Container>
    );
}

export default Project;
